select distinct code_mo													
,month,SchetType													
,t.usl_ok+'  '+t.tip+' ' +isnull(nam,''),												
count (distinct id) [ЙНК-БН ГЮЙ ЯКСВЮЕБ ОНДЮММШУ МЮ НОЮРС]
,sum(case when idsp in (25,35,36) and pr_nov=0 then 0 else sumv end) [ОНДЮМН МЮ ЯСЛЛС],
count (distinct  case when sank is not null then id end) [яМЪРН ОН ЛЩЙ],		
sum(case when sank is not null then sumv end) [яМЪРН ОН ЛЩЙ МЮ ЯСЛЛС],		
count(distinct  case when sank is null then id end) [ЙНК-БН НОКЮВЕММШУ ГЮЙ ЯКСВЮЕБ], 		
sum(case when sank is null then case when idsp in (25,35,36) and pr_nov=0 then 0 else sumv end end) [НОКЮВЕМН МЮ ЯСЛЛС]		
,count (distinct  case when s_osn in ('1.6.2.') then id end ) [ЯМЪРН ОН НАЗЕЛЮЛ Б 10 ЛЕЯЪЖЕ]		
--,count (distinct case when sank.s_osn in ('5.3.2.','1.6.2.') then zs.id end ) [ЯМЪРН ОН НАЗЕЛЮЛ]		
,isnull(sum (case when  s_osn in ('1.6.2.')  then sumv end),0) [ЯМЪРН ОН НАЗЕЛЮЛ МЮ ЯСЛЛС Б 10 ЛЕЯ ]														
from 													
(select distinct --sank.id sank,sank.S_OSN, 
zs.IDSP,zs.PR_NOV,
sch.code_mo,sch.MONTH,sch.SchetType,  zs.id,---s.NHISTORY,
s.sum_m SUMV,sank.id sank,sank.s_osn s_osn,v.UMPNAME usl_ok,													
CASE 													
										WHEN s.P_CEL25='1.1' THEN 'менркнфйю юоо'			
										WHEN  ( (s.P_CEL25 LIKE '1%' AND s.P_CEL25 NOT LIKE '1.1')			
												OR 	s.P_CEL25 IN ('2.1','2.5','2.6')
												AND    zs.OS_SLUCH_REGION IS NULL	
												) OR	
												zs.OS_SLUCH_REGION in (29,35,48,23,12,18)  THEN 'опнтхкюйрхйю юоо'	
										WHEN 			
										(s.P_CEL25 = '3.0' and OS_SLUCH_REGION is null)			
										or 			
										zs.OS_SLUCH_REGION in (21,30,31,32,33,34,36,39,40) 			
										OR 			
										(s.P_CEL25='2.3' AND usl.CODE_USL like 'R03%')			
											then 'гюанкебюмхъ юоо'		
											WHEN  		
										zs.OS_SLUCH_REGION in (6) 			
											then 'гюанкебюмхъ юоо ЦЕЛНДХЮКХГ'		
										when usl.code_usl like 'R01%' then ms.name			
										ELSE ''			
										END tip	,db.Name nam		
FROM [D3_SCHET_OMS] sch													
		inner join D3_PACIENT_OMS p on p.d3_scid=sch.id											
		inner join D3_ZSL_OMS zs on zs.D3_PID=p.id											
		inner join d3_sl_oms s on s.D3_ZSLID=zs.id 											
		LEFT JOIN [D3_USL_OMS] usl on usl.D3_SLID=s.id	
		left join OsobSluchDb db on db.Id=zs.OS_SLUCH_REGION
		left join medicalServices ms on ms.code_usl =usl.CODE_USL and s.DATE_2 between ms.dataBegin and isnull(ms.dataend,'20991231')											
		left join [D3_SANK_OMS] sank on sank.[D3_ZSLID]=zs.id and sank.s_tip=1								
		left join v006 v on v.IDUMP=zs.USL_OK											
		where sch.year=2023
		and sch.month=1											
		and sch.code_mo IN (460026)	
	--	and zs.[NotExist] is null
		------------------------------------------										
													
													
													
		)t											
		group by code_mo,											
		month,	SchetType,										
		t.usl_ok+'  '+t.tip+' ' +isnull(nam,'')					









